import React from 'react';

class ViewBuilding extends React.Component {

	render() {
		const { data, building } = this.props;
		var tmp = data[building];

		return (
			<div>
				<p>
					<tr key={tmp.id} >
						<td>{tmp.code} </td>
						<td> {tmp.name} </td>
					</tr>
					{' '}
					<i>Click on a name to view more information</i>
				</p>
			</div>
		);
	}
}
export default ViewBuilding;
